INSERT INTO `email_templates` (`id`, `slug`, `subject`, `body`, `deleted_at`, `created_at`, `updated_at`) VALUES (1,'activate_account','Activate Account','<p>Welcome to {SITE_NAME}!</p>\r\n\r\n<p>Thanks for joining {SITE_NAME}. We listed your sign in details below, make sure you keep them safe.</p>\r\n\r\n<p>To verify your email address, please follow this link:<br>\r\n<big><strong><a href=\"{ACTIVATE_URL}\">Finish your registration...</a></strong></big><br>\r\nLink doesn\'t work? Copy the following link to your browser address bar:<br>\r\n<a href=\"{ACTIVATE_URL}\">{ACTIVATE_URL}</a></p><p>\r\n<br>\r\nHave fun!<br>\r\nThe {SITE_NAME} Team</p>',NULL,'2018-05-24 06:26:04','2020-11-18 12:24:57'),(2,'forgot_password','Forgot Password','<p><span style=\"font-family: Arial;\"></span>New Password</p>\r\n\r\n<p>Forgot your password, huh? No big deal.<br>\r\nTo create a new password, just follow this link:<br>\r\n<br>\r\n<big><strong><a href=\"{PASS_KEY_URL}\">Create a new password</a></strong></big><br>\r\nLink doesn\'t work? Copy the following link to your browser address bar:<br>\r\n<a href=\"{PASS_KEY_URL}\">{PASS_KEY_URL}</a><br>\r\n<br>\r\n<br>\r\nYou received this email, because it was requested by a {SITE_NAME} user.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This is part of the procedure to create a new password on the system. If you DID NOT request a new password then please ignore this email and your password will remain the same.</p>\r\n\r\n<p><br>\r\nThank you,<br>\r\nThe {SITE_NAME} Team</p>\r\n\r\n<p>&nbsp;</p>',NULL,'2018-05-26 06:01:57','2018-06-13 23:48:24'),(3,'contact_query','A user has contact for you his query','<p>Hello Admin</p>\r\n\r\n<p>There is query from user at&nbsp;{SITE_NAME}.&nbsp;</p>\r\n\r\n<p>Below are the detail of user and his query: &nbsp;<br>\r\nEmail: {EMAIL}<br>\r\nName: {NAME}<br>\r\nMobile : {MOBILE}<br>\r\nMessage: {MESSAGE}</p>\r\n\r\n<p><br>\r\nHave fun!<br>\r\nThe {SITE_NAME} Team.</p>',NULL,'2018-06-07 03:46:02','2018-11-27 09:04:33'),(4,'security_alert','Security alert','<p>Hello {NAME}<br></p><p>Your {SITE_NAME} Account was just updated. You\'re getting this email to make sure it was you.<br></p>\r\n<p><br>\r\nThank you,<br>\r\nThe {SITE_NAME} Team</p>\r\n\r\n<p>&nbsp;</p>',NULL,'2018-06-08 02:38:51','2018-06-08 02:47:15'),(5,'user_sent_request','A user has sent a withdrawal request of amount ${AMOUNT}.','<p>Hello Admin</p>\r\n\r\n<p>A user has sent a withdrawal request at&nbsp;{SITE_NAME}.&nbsp;</p>\r\n\r\n<p>Below are the detail of withdrawal request:&nbsp;<br>\r\nUser: {USER}<br>\r\nRequest Date: {REQUEST_DATE}<br>\r\nAmount: $ {AMOUNT}<br>\r\nComment: {COMMENT}</p>\r\n\r\n<p><br>\r\nRegards!<br>\r\nThe {SITE_NAME} Team.</p>',NULL,'2018-06-08 03:31:28','2018-06-08 03:31:28'),(6,'approve_withdraw_request','Hey {USERNAME}! Admin has approved your withdrawal request of amount ${AMOUNT}.','<p>Hi {USERNAME}</p><p><br></p>\n\n<p>Admin has approved your withdrawal request at {SITE_NAME}. Details are as below:</p><p>Amount : ${AMOUNT}</p><p> Transaction Id : {TRANSACTION_ID}</p><p>Payment Method : {PAYMENT_THRO}</p>\n\n<p><br>\nRegards!<br>\nThe {SITE_NAME} Team.</p>',NULL,'2018-06-08 03:45:51','2019-05-03 03:44:36'),(7,'withdraw_error','Withdrawal error with Transaction Id {TRANSACTION_ID}','<p>Hello Admin,</p><p><br></p>\n\n<p>There is some problem with withdrawal method {METHOD_NAME} at {SITE_NAME}</p>\n<p>{ERROR}</p>\n<p><br>\nThank you,<br>\nThe {SITE_NAME} Team</p>\n\n<p>&nbsp;</p>',NULL,'2018-06-08 06:23:49','2019-05-03 03:42:52'),(8,'withdraw_success','Withdrawal success of {USERNAME} with ${AMOUNT}','<p>Hello Admin,</p><p><br></p>\n\n<p>You have successfully approved a user withdrawal request at {SITE_NAME}. Details are as below:</p><p><br></p>\n<p>\nName: {USERNAME}<br>\nAmount: ${AMOUNT}<br>\nTransaction Id: {TRANSACTION_ID}<br>\n</p>\n<p><br>\nThank you,<br>\nThe {SITE_NAME} Team</p>',NULL,'2018-06-08 04:23:49','2019-05-03 03:42:28'),(9,'subscriber_template','Subscriber template','<p>He