our site!</p>\n</div>\n</div>\n\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"accountop\"><img class=\"img-responsive\" src=\"public/themes/echyip/assets/images/accountbox1.png\"></div>\n</div>\n</div>\n</div>\n\n<div class=\"howIt\">\n<div class=\"row\">\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"registeryop\">\n<h2>2. LOGIN TO MEMBERS AREA</h2>\n<p>Once youve opened an account, the next thing would be to familiarize yourself with how different sections of your account works. To start, go to the login page and enter your registration username and chosen password. After you are logged in, you can explore your account and get a feel of how everything works, such as making deposits, requesting withdrawals, etc.</p>\n</div>\n</div>\n\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"accountop\"><img class=\"img-responsive\" src=\"public/themes/echyip/assets/images/accountbox2.png\"></div>\n</div>\n</div>\n</div>\n\n<div class=\"howIt\">\n<div class=\"row\">\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"registeryop\">\n<h2>3. MAKE YOUR FIRST DEPOSIT</h2>\n<p>To start growing your Bitcoins, you need to make a deposit. You can do this from the deposit section of your account. There are 2 investment plans ranging from 1%-2% Daily depending on the amount of your deposit. you are allowed to make as many deposits as you want. However, every deposit is treated as a separate investment.</p>\n</div>\n</div>\n\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"accountop\"><img class=\"img-responsive\" src=\"public/themes/echyip/assets/images/accountbox3.png\"></div>\n</div>\n</div>\n</div>\n\n<div class=\"howIt\">\n<div class=\"row\">\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"registeryop\">\n<h2>4. WATCH YOUR OMNIHYIP CAPITAL</h2>\n<p>After you have made a deposit, there is nothing else to do except watch your earnings grow in your account every day. This can be fun, because it means you can be anywhere you want to be in the world, and your Bitcoins/Investment will still be growing in your account every day, even without you doing anything!\n</p>\n</div>\n</div>\n\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"accountop\"><img class=\"img-responsive\" src=\"public/themes/echyip/assets/images/accountbox4.png\"></div>\n</div>\n</div>\n</div>\n\n<div class=\"howIt\">\n<div class=\"row\">\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"registeryop\">\n<h2>5. REQUEST WITHDRAWALS</h2>\n<p>It only takes 24 hours to pay and have your earnings paid to you. your withdrawal will be sent to the Bitcoin address or other payment method that you provided during registration.\n</p>\n</div>\n</div>\n\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"accountop\"><img class=\"img-responsive\" src=\"public/themes/echyip/assets/images/accountbox5.png\"></div>\n</div>\n</div>\n</div>\n\n<div class=\"howIt\">\n<div class=\"row\">\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"registeryop\">\n<h2>6. REFER YOUR FRIENDS</h2>\n<p>You dont need an active deposit to take advantage of our referral program. As long as you are a registered member, you only need to use your personal affiliate link from your members area and share it with your friends. You will get rewarded as soon as they join and make their first deposit!\n\n</p>\n</div>\n</div>\n\n<div class=\"col-lg-6 col-md-6 col-sm-12\">\n<div class=\"accountop\"><img class=\"img-responsive\" src=\"public/themes/echyip/assets/images/accountbox6.png\"></div>\n</div>\n</div>\n</div>\n\n                </div>\n            </div>\n        </section>','','','',NULL,'[]',0,'default','default',33,'how-it-work','hide',NULL,NULL,'2018-05-29 17:58:42','2021-02-10 08:27:56'),(6,'Terms & Conditions','Terms & Conditions','Terms & Conditions','Terms & Conditions','','<div class=\"termouter\">\r\n               <div class=\"container\">\r\n                  <div class=\"row\">\r\n                     <div class=\"c